import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import '../assets/styles/wedding-header.css'; // Import your custom CSS for styling
import WeddingNavBar from './WeddingNavBar';

const WeddingHeader = () => {
  return (
    <header className="header-section">
      <WeddingNavBar />
      <Container>
        <Row>
          <Col className="text-center text-light">
            <div className="header-title">Welcome to My Website</div>
            <div className="header-subtitle">A responsive header with a big background image</div>
          </Col>
        </Row>
      </Container>
    </header>
  );
};

export default WeddingHeader;
